import React, { useState } from "react";

const ChatScreen = () => {
  const [messages, setMessages] = useState([
    {
      name: "manpal",
      image: "https://homepages.cae.wisc.edu/~ece533/images/baboon.png",
      message: "hi, whats up",
    },
    {
      name: "ravi",
      image: "https://homepages.cae.wisc.edu/~ece533/images/pool.png",
      message: "there?",
    },
    {
      name: "manpal",
      image: "https://homepages.cae.wisc.edu/~ece533/images/peppers.png",
      message: "all good",
    },
  ]);
  return (
    <div className="chat-screen">
      <p>You matched with Manpal on 16/09/20</p>
      {messages.map((message) => (
        <div className='chat'>
          <p>{message.message}</p>
        </div>
      ))}
    </div>
  );
};

export default ChatScreen;
